import React from 'react'
import { CircularProgressbar, buildStyles } from 'react-circular-progressbar'

const CardGraph = () => {
    const percentage = 66;
    return (
        <div>
            <CircularProgressbar 
            value={percentage}
            text={`${percentage}%`}
            styles={buildStyles({
                rotation: 0.25,
                pathTransition:0.8,
                pathTransitionDuration:2
            })}/>
        </div>
    )
}

export default CardGraph
